export default (function(a,b,c,d,e,f,g,h,i){return {data:{voilT7NTOq:{data:{id:765,attributes:{imdbId:"tt0106664",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTAxOTA1NDQzODVeQTJeQWpwZ15BbWU3MDYyNzEzMzQ@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.0\u002F10"},{Source:"Rotten Tomatoes",Value:"58%"},{Source:"Metacritic",Value:"53\u002F100"}],item_lang:{data:{id:1428,attributes:{title:c,plot:"When Thad Beaumont was a child, he had an operation to remove a tumour from his brain. during the operation, it was discovered that far from being a tumor, the growth was a twin brother of Thad's that never developed. Years later, Thad is a successful author, writing his serious books under his own name, and his pulp money-makers under the pseudonum \"George Stark\". When blackmailed by someone who has discovered his secret, Thad publically \"buries\" George Stark. From that point on, Thad increasingly becomes the prime suspect in a series of gruesome murders.",slug:"the-dark-half"}}},books:{data:[{id:4893,attributes:{title:c,description:e,thumbnail:f,authors:[a],firstBook:true,published:g,publisher:h,subtitle:d}},{id:4894,attributes:{title:c,description:e,thumbnail:f,authors:[a],firstBook:b,published:g,publisher:h,subtitle:d}},{id:4895,attributes:{title:"Stephen King, American Master",description:"Fascinating facts, trivia, and little-known details about the Master of the Macabre’s life from the “world’s leading authority on Stephen King” (Entertainment Weekly). New York Times–bestselling author Stephen Spignesi has compiled interviews, essays, and loads of facts and details about all of Stephen King’s work into this fun and informative compendium for the author’s many fans, from the casual to the fanatical! Did you know. . . ? In his early teens, Stephen King sold typed copies of his short stories at school. King originally thought his novel Pet Sematary was too frightening to publish. King’s legendary Dark Tower series took him more than 30 years to write. Thinner was the novel that revealed his “Richard Bachman” pseudonym to the world. King wrote The Eyes of the Dragon for his daughter Naomi. He has never liked Stanley Kubrick’s film version of his novel The Shining. It took him four years to write what some consider his magnum opus, IT. The 2017 film version of IT has grossed more than $700 million worldwide. In addition to novels, King has written essays, plays, screenplays, and even poetry.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=uMhyDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Stephen Spignesi"],firstBook:b,published:"2018-10-30",publisher:"Permuted Press+ORM",subtitle:"A Creepy Corpus of Facts About Stephen King & His Work"}},{id:4896,attributes:{title:a,description:"Titles include \"The Stand, Complete And Uncut\" and \"The Dark Half\".",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=hEnAAAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:b,published:"1995-09-15",publisher:i,subtitle:"The Stand, the Dark Half"}},{id:4897,attributes:{title:"Stephen King 8",description:"The Stand: Complete and Uncut))The Dark Half))2",thumbnail:d,authors:[a],firstBook:b,published:"1991-06-01",publisher:i,subtitle:"Stand, Dark Half"}}]}}},meta:{}}},prerenderedAt:1680940952326}}("Stephen King",null,"The Dark Half","","Thad, a college professor who moonlights as a writer of pop thrillers under the pseudonym George Stark, finally writes a serious novel, and decides to stop writing shockers. But George Stark has come to life and doesn't want to die. Thad is forced to battle his own creation for the control of the mind which both must share.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=rIOMCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2016-02-16","Simon and Schuster","New Amer Library"))